inline cFontPtr NEW_CFONT_CALIBRI_16()
{
    cImage *img = new chai3d::cImage();
    cLoadPNG(img, CFONT_CALIBRI_16_BYTEARRAY, sizeof(CFONT_CALIBRI_16_BYTEARRAY));

    cFontPtr font = cFont::create();
    font->m_charset.m_base       = CFONT_CALIBRI_16_CHARSET_BASE;
    font->m_charset.m_lineHeight = CFONT_CALIBRI_16_CHARSET_LINEHEIGHT;
    font->m_charset.m_width      = CFONT_CALIBRI_16_WIDTH;
    font->m_charset.m_height     = CFONT_CALIBRI_16_HEIGHT;
    font->m_charset.m_pages      = CFONT_CALIBRI_16_CHARSET_PAGES;
    for (int i=0; i<256; i++)
    {
        font->m_charset.m_chars[i].m_x        = CFONT_CALIBRI_16_CHARSET[8*i  ];
        font->m_charset.m_chars[i].m_y        = CFONT_CALIBRI_16_CHARSET[8*i+1];
        font->m_charset.m_chars[i].m_width    = CFONT_CALIBRI_16_CHARSET[8*i+2];
        font->m_charset.m_chars[i].m_height   = CFONT_CALIBRI_16_CHARSET[8*i+3];
        font->m_charset.m_chars[i].m_xOffset  = CFONT_CALIBRI_16_CHARSET[8*i+4];
        font->m_charset.m_chars[i].m_yOffset  = CFONT_CALIBRI_16_CHARSET[8*i+5];
        font->m_charset.m_chars[i].m_xAdvance = CFONT_CALIBRI_16_CHARSET[8*i+6];
        font->m_charset.m_chars[i].m_page     = CFONT_CALIBRI_16_CHARSET[8*i+7];
    }
    font->m_charset.preProcess();

    font->m_texture->setImage(std::shared_ptr<chai3d::cImage>(img));

    return (font);
}


